import "./Main.scss";
import {data} from "../../helpers/data";


const Main = ()=> {
    return(
        <div className="card-container">
            {data.map((item) => {

                return(
                    <div className="card">
                        {item.title}
                        <img src={item.img} alt="" />
                    </div>
                )


            })}
        </div>
    )
}

export default Main
